    return(
    <header>
        <div id="headerPicture">
        <img src={headerImg} alt="headerPicture" width="100" height="100"/>
       </div>
        <p>
        <Link to='/dates'>Daten</Link>
        <br/>

       </p>



        </header>
  );
  }
}

export default Header;
